import FinancialDataComponent from "./FinancialDataComponent";
import useStore from '../../../stores/useStore';
import shallow from 'zustand/shallow';
import countries from '../../../assets/countries.json';
import { useEffect } from "react";

const getState = state => [
    state.financialData,
    state.setFinancialData,
    state.getFinancialData
];
const FinancialData = () => {
    const [financialData, setFinancialData, getFinancialData] = useStore(getState, shallow);
    useEffect(()=>{getFinancialData();})
    return <FinancialDataComponent />;
}

export default FinancialData;
